import axiosClient from "./axiosClient";

const UserAPI = {
   getDetailData: (id) => {
      const url = `/users/${id}`;
      return axiosClient.get(url, { withCredentials: true });
   },
   postSignUp: (data) => {
      const url = `/signup`;
      return axiosClient.post(url, data);
   },
   postLogin: (data, config) => {
      const url = `/login`;
      return axiosClient.post(url, data, config || {});
   },
};

export default UserAPI;
